import './App.css';
import React from 'react';
import { useState, useEffect } from 'react';
import axios from 'axios';
import {
  TextField,
  Button,
  Typography,
  Link,
  IconButton,
  InputAdornment,
} from '@mui/material';
import Visibility from '@mui/icons-material/Visibility';
import VisibilityOff from '@mui/icons-material/VisibilityOff';
import Grid from '@mui/material/Grid2';
import { login, logout } from './services/authService';
import { register } from './services/userService';
import useAuthStore from './store/authStore';
import useUserStore from './store/userStore';

function App() {

  const [registrationToggle, setRegistrationToggle] = useState(false);
  const [currentUser, setCurrentUser] = useUserStore();
  const { email, password, setEmail, setPassword } = useAuthStore();  
  const [showPassword, setShowPassword] = useState(false);

  useEffect(() => {
    checkUserStatus();
  }, []);

  const checkUserStatus = async () => {
    try {
      const response = await axios.get("/api/user");
      setCurrentUser(true);
    } catch (error) {
      setCurrentUser(false);
    }
  };

  const submitRegistration = async (e) => {
    e.preventDefault();
    try {
      await register(email, password);
    } catch (error) {
      console.error('Registration failed:', error);
    }
  }

  const submitLogin = async (e) => {
    e.preventDefault();
    client.post(
      "/api/login",
      {
        email: email,
        password: password
      }
    ).then(function(res) {
      setCurrentUser(true);
    });
  }

  const handleLoginSubmit = async (e) => {
    e.preventDefault();
    try {
      await login(email, password);
      setEmail('');
      setPassword('');
      setCurrentUser(true);
    } catch (error) {
      console.error('Ha ocurrido el siguiente error al intentar hacer Login', error);
    }
  };

  function submitLogout(e) {
    e.preventDefault();
    client.post(
      "/api/logout",
      {withCredentials: true}
    ).then(function(res) {
      setCurrentUser(false);
    });
  }

  if (currentUser) {
    return (
      <div>
        <div className="center">
          <h2>You're logged in!</h2>
        </div>
        <form onSubmit={e => submitLogout(e)}>
          <Button type="submit" variant="light">Log out</Button>
        </form>
      </div>
    );
  }
  return (
    <Grid container spacing={2} style={{ height: '100vh', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
      <Grid xs={12} sm={6} md={4}>
        <form onSubmit={submitLogin}>
          <Typography variant="h3" fontFamily="'Pacifico', cursive" sx={{ textAlign: 'center' }}>Instagram</Typography>
          <TextField
            fullWidth
            label="Correo electrónico"
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            margin="normal"
          />
          <TextField
            fullWidth
            label="Contraseña"
            type={showPassword ? "text" : "password"}
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            margin="normal"
            slotProps={{
              input: {
                endAdornment: (
                  <InputAdornment position="end">
                    <IconButton
                      edge="end"
                      onClick={() => setShowPassword(!showPassword)}
                      onMouseDown={(e) => e.preventDefault()}
                    >
                      {showPassword ? <Visibility /> : <VisibilityOff />}
                    </IconButton>
                  </InputAdornment>
                )
              }
            }}
          />
          <Grid container justifyContent="end" >
            <Grid>
              <Link href="/forgot-password" sx={{ color: '#00bbf0'}}>¿Olvidaste tu contraseña?</Link>
            </Grid>
          </Grid>
          <Button
            type="submit" 
            variant="contained" 
            sx={{ backgroundColor: '#00bbf0', marginTop: '20px'}}
            fullWidth  
          >
            Iniciar sesión
          </Button>
          <Grid container justifyContent="flex-start" mt={2}>
            <Grid>
              <span>¿No tienes una cuenta? </span>
              <Link href="/register" sx={{ color: '#00bbf0'}}>Registrate</Link>
            </Grid>
          </Grid>
        </form>
      </Grid>
    </Grid>
  );
}

export default App;
